import "../css/Help.css";

const Help = () => {
  return (
    <>
      <div className="help">
        <ul className='help_lists'>
          <li className='help_list'>Topics</li>
          <li className='help_list'>Training</li>
          <li className='help_list'>What's new</li>
          <li className='help_list'>Suggest a feature</li>
          <li className='help_list'>Ask the community</li>
        </ul>
      </div>
    </>
  );
};

export default Help;
